define({"topics" : [{"title":"About Chart Types","shortdesc":"<p class=\"shortdesc\">The basic types of charts.</p>","href":"charttypes\/charttype_over.html","attributes": {"data-id":"charttype_over",},"menu": {"hasChildren":false,},"tocID":"charttype_over-d61e6659","topics":[]},{"title":"Task: Column Chart","shortdesc":"<p class=\"shortdesc\">A chart type that is very suitable for displaying time series.</p>","href":"charttypes\/charttype_column.html","attributes": {"data-id":"charttype_column",},"menu": {"hasChildren":false,},"tocID":"charttype_column-d61e6677","topics":[]},{"title":"Task: Bar Chart","shortdesc":"<p class=\"shortdesc\">Chart type that is very suitable for displaying rankings.</p>","href":"charttypes\/charttype_bar.html","attributes": {"data-id":"charttype_bar",},"menu": {"hasChildren":false,},"tocID":"charttype_bar-d61e6695","topics":[]},{"title":"Task: Pie Chart","shortdesc":"<p class=\"shortdesc\">A pie chart, showing the percentage distribution within one data series         (group).</p>","href":"charttypes\/charttype_pie.html","attributes": {"data-id":"charttype_pie",},"menu": {"hasChildren":false,},"tocID":"charttype_pie-d61e6713","topics":[]},{"title":"Task: Line Chart","shortdesc":"<p class=\"shortdesc\">You use a line chart to visualize a trend in data over intervals of time.</p>","href":"charttypes\/charttype_line.html","attributes": {"data-id":"charttype_line",},"menu": {"hasChildren":false,},"tocID":"charttype_line-d61e6731","topics":[]},{"title":"Task: Scatter (XY) Chart","shortdesc":"<p class=\"shortdesc\">A scatter chart (XY diagram) is very suitable if you want to analyze and show the         relationship between two numeric variables. It also allows you to determine a trend         line.</p>","href":"charttypes\/charttype_scatter.html","attributes": {"data-id":"charttype_scatter",},"menu": {"hasChildren":false,},"tocID":"charttype_scatter-d61e6749","topics":[]},{"title":"Line or Scatter Chart?","shortdesc":"<p class=\"shortdesc\">The differences between a line chart and a xy (scatter) chart.</p>","href":"charttypes\/charttype_line_scatter.html","attributes": {"data-id":"charttype_line_scatter",},"menu": {"hasChildren":false,},"tocID":"charttype_line_scatter-d61e6767","topics":[]},{"title":"Task: Doughnut Chart","shortdesc":"<p class=\"shortdesc\">A doughnut chart can be used if you want to show the percentage distribution of         multiple data series.</p>","href":"charttypes\/charttype_doughnut.html","attributes": {"data-id":"charttype_doughnut",},"menu": {"hasChildren":false,},"tocID":"charttype_doughnut-d61e6785","topics":[]},{"title":"Task: Area Chart (stacked)","shortdesc":"<p class=\"shortdesc\">You use an area chart to plot multiple data series over some time. If the sum of the         values is also important then use a stacked area chart.</p>","href":"charttypes\/charttype_area.html","attributes": {"data-id":"charttype_area",},"menu": {"hasChildren":false,},"tocID":"charttype_area-d61e6803","topics":[]},{"title":"Task: Bubble Chart","shortdesc":"<p class=\"shortdesc\">A bubble chart can be used if you want to display the relationship between three         numeric variables.</p>","href":"charttypes\/charttype_bubble.html","attributes": {"data-id":"charttype_bubble",},"menu": {"hasChildren":false,},"tocID":"charttype_bubble-d61e6821","topics":[]},{"title":"Task: Radar Chart","shortdesc":"<p class=\"shortdesc\">A radar chart (spider chart) can be used if you want to plot multiple categories         among separate axes.</p>","href":"charttypes\/charttype_radar.html","attributes": {"data-id":"charttype_radar",},"menu": {"hasChildren":false,},"tocID":"charttype_radar-d61e6840","topics":[]},{"title":"Translation chart type names","shortdesc":"<p class=\"shortdesc\">Dutch, English, and German names of some chart types.</p>","href":"charttypes\/charttype_translations.html","attributes": {"data-id":"charttype_translations",},"menu": {"hasChildren":false,},"tocID":"charttype_translations-d61e6858","topics":[]}]});